export default class Calculo {
}
/*
export - permite que a clase seja usada em outro arquivo
default - permite importar sem chaves ex: import Calculo from "./calculo.ts"
abstract -
quando colocada na CLASSE, faz com que ela não possa ser instanciada diretamente,
não pode fazer 'new Calculo'

quando colocada no METODO, faz com que toda classe filha tenha que utilizar/implementar esse método
ou o TypeScript vai dar erro de compilação


public - todos os modulos do projeto podem acessar
private - apenas a propria classe pode acessar
protected - Apenas a classe e suas filhas podem acessar
*/ 
